                mst.append(edge)
                if len(mst) == n - 1:
                    break
                union(parent, rank, u, v)

        return mst

    def find(parent, i):
        if parent[i] != i:
            parent[i] = find(parent, parent[i])
        return parent[i]

    def union(parent, rank, i, j):
        i_root = find(parent, i)
        j_root = find(parent, j)

        if rank[i_root] < rank[j_root]:
            parent[i_root] = j_root
        elif rank[i_root] > rank[j_root]:
            parent[j_root] = i_root
        else:
            parent[j_root] = i_root
            rank[i_root] += 1

    def is_valid_spanning_tree(graph, n, m, target):
        visited = [False] * (n + 1)
        stack = []
        dfs(graph, visited, stack, 1, target)
        return len(stack) == n and stack[0] == 1

