        max_count = max(char_count.values())
        return max_count

    min_colors = find_min_colors(s)
    color_count = min_colors
    result = [1] * n

    while not is_sorted(s):
        swap_count = 0
        for i in range(1, n):
            if s[i - 1] > s[i]:
                color_index = (result[i - 1] + result[i]) % min_colors + 1
                result[i - 1] = color_index
                result[i] = color_index
                s = s[:i - 1] + s[i] + s[i - 1] + s[i + 1:]
                swap_count += 1
