        row_sums = [sum(row) for row in matrix]
        col_sums = [sum(col) for col in zip(*matrix)]
        return all(row_sums[i] <= row_sums[i + 1] for i in range(n - 1)) and all(col_sums[i] <= col_sums[i + 1] for i in range(m - 1))

    def invert_row(matrix, i):
        matrix[i] = [1 - x for x in matrix[i]]

    def invert_col(matrix, j):
        for i in range(n):
            matrix[i][j] = 1 - matrix[i][j]

    def perform_operations(matrix, operations):
        for i, op in enumerate(operations):
            if op == 'r':
                invert_row(matrix, i)
            elif op == 'c':
                invert_col(matrix, i)
        return matrix

    # Try to sort the matrix using the greedy algorithm
    # If it's impossible, the matrix will not be sorted
    operations = []
    for _ in range(n + m):
        if all(row_sums[i] >= row_sums[i + 1] for i in range(n - 1)) and all(col_sums[i] >= col_sums[i + 1] for i in range(m - 1)):
            break
        elif n > 1 and all(row_sums[i] < row_sums[i + 1] for i in range(n - 1)):
            invert_row(a, n - 1)
            operations.append('r')
        elif m > 1 and all(col_sums[i] < col_sums[i + 1] for i in range(m - 1)):
            invert_col(a, m - 1)
            operations.append('c')
        else:
