        while current_level:
            next_level = find_next_level(current_level, level)
            next_level_distance = sum(distance(p, next_level[0]) for p in next_level)
            total_distance += next_level_distance
            visited.update(current_level)
            current_level = find_adjacent(next_level[0])
            for p in current_level:
                if p in visited:
                    current_level.remove(p)
            level += 1
        return total_distance

