def solution(stdin: str) -> str:
    S = stdin.strip()
    result = 0

    def evaluate(s: str) -> int:
        stack = []
        for c in s:
            if c.isdigit():
                stack.append(int(c))
            elif c == '+':
                if len(stack) < 2:
                    return -1
                op2 = stack.pop()
                op1 = stack.pop()
                stack.append(op1 + op2)
            elif c == '-':
                if len(stack) < 2:
                    return -1
                op2 = stack.pop()
                op1 = stack.pop()
                stack.append(op1 - op2)
        return stack[0] if len(stack) == 1 else -1

    def backtrack(start: int, end: int) -> None:
        if start == end:
            res = evaluate(S)
            if res != -1:
                nonlocal result
                result += res
        else:
            for i in range(start + 1, end):
                if S[i] == '+':
                    continue
                S = S[:i] + '+' + S[i:]
                backtrack(start, i)
                backtrack(i + 2, end)
                S = S[:i] + S[i + 1:]

    backtrack(0, len(S))
    return str(result)


