        for col in range(C):
            for row in range(initial_heights[col]):
                if config[col][row] == 1:
                    return False
        return True

    def generate_configs():
        configs = []
        for _ in range(2 ** C):
            config = [0] * C
            binary = format(_, f'0{C}b')
            for col, bit in enumerate(binary):
                config[col] = int(bit)
            if is_valid(config):
                configs.append(config)
        return configs

    def count_configs(configs):
        counts = [0] * 8
        for config in configs:
            for rot in range(8):
                counts[rot] += count_rotation(config, rot)
        return counts

    def count_rotation(config, rot):
        counts = [0] * (2 ** C)
        for i, row in enumerate(config):
            for j, col in enumerate(row):
                if col == 1:
                    for k, bit in enumerate(format(i, f'0{C}b')):
                        if bit == '0':
                            break
                    else:
                        continue
                    xor = (i ^ (1 << k)) & ((1 << C) - 1)
                    counts[xor ^ (rot // 2)] += 1
        return sum(counts)

    def tetromino_shapes():
        shapes = []
        for rot in range(8):
            shape = [[0] * 4 for _ in range(4)]
            for i in range(4):
                for j in range(4):
                    if (rot >> 1) & 1 == 0:
                        shape[i][j] = (i >> 1) ^ (j >> 1)
                    else:
                        shape[i][j] = (i & 1) ^ (j >> 1)
            shapes.append(shape)
        return shapes

    configs = generate_configs()
    counts = count_configs(configs)
    shapes = tetromino_shapes()
    return str(sum(counts[rot] for rot in range(8) if shapes[P][rot][0] == 0))


