class AutokeyCipher:
    def __init__(self, key: str):
        self.key = key.lower()
        self.key_index = 0

    def encrypt(self, plaintext: str) -> str:
        ciphertext = ""
        for i, char in enumerate(plaintext.lower()):
            if char.isalpha():
                key_char = self.key[self.key_index % len(self.key)]
                self.key_index += 1
                shift = ord(key_char) - ord('a')
                if char.islower():
                    ciphertext += chr((ord(char) - ord('a') + shift) % 26 + ord('a'))
                else:
                    ciphertext += chr((ord(char) - ord('A') + shift) % 26 + ord('A'))
            else:
                ciphertext += char
        return ciphertext

    def decrypt(self, ciphertext: str) -> str:
        plaintext = ""
        for i, char in enumerate(ciphertext.lower()):
            if char.isalpha():
                key_char = self.key[self.key_index % len(self.key)]
                self.key_index += 1
                shift = ord(key_char) - ord('a')
                if char.islower():
                    plaintext += chr((ord(char) - ord('a') - shift) % 26 + ord('a'))
                else:
                    plaintext += chr((ord(char) - ord('A') - shift) % 26 + ord('A'))
            else:
                plaintext += char
        return plaintext

