def solution(stdin: str) -> str:
    input_list = stdin.split('\n')
    n, k = map(int, input_list[0].split())
    art_installation = [[0] * n for _ in range(n)]

    for i in range(1, n + 1):
        tile_numbers = list(map(int, input_list[i].split()))
        for j, tile_number in enumerate(tile_numbers):
            art_installation[i - 1][j] = tile_number

    def manhattan_distance(a, b):
        return abs(a[0] - b[0]) + abs(a[1] - b[1])

    def bfs(start_tile, end_tile):
        visited = [[False] * n for _ in range(n)]
        queue = [(start_tile, 0)]

        while queue:
            tile, distance = queue.pop(0)

            if tile == end_tile:
                return distance

            for i, j in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
                new_tile = (tile[0] + i, tile[1] + j)
                if 0 <= new_tile[0] < n and 0 <= new_tile[1] < n and not visited[new_tile[0]][new_tile[1]] and art_installation[new_tile[0]][new_tile[1]]:
                    visited[new_tile[0]][new_tile[1]] = True
                    queue.append((new_tile, distance + manhattan_distance(tile, new_tile)))

        return -1

    start_tile = (0, 0)
    end_tile = (n - 1, n - 1)
    shortest_distance = bfs(start_tile, end_tile)

    return str(shortest_distance)

